// I-Beam Asymmetric about z-axis (I in Nastran and HAT in Astros 21.2)
void MAST::Solid1DISectionProperty::calcA(Real& DIM1, Real& DIM2, Real& DIM3, Real& DIM4, Real& DIM5, Real& DIM6, Real& A){
    A = -DIM4*(-DIM1+DIM5+DIM6)+DIM2*DIM5+DIM3*DIM6;
}

void MAST::Solid1DISectionProperty::calcdA(Real& DIM1, Real& DIM2, Real& DIM3, Real& DIM4, Real& DIM5, Real& DIM6, Real& dDIM1, Real& dDIM2, Real& dDIM3, Real& dDIM4, Real& dDIM5, Real& dDIM6, Real& dA){
    dA = DIM4*dDIM1+DIM5*dDIM2+DIM6*dDIM3+dDIM5*(DIM2-DIM4)+dDIM6*(DIM3-DIM4)-dDIM4*(-DIM1+DIM5+DIM6);
}

