void MAST::Solid1DISectionProperty::calcJ1_w(Real& DIM1, Real& DIM2, Real& DIM3, Real& DIM4, Real& DIM5, Real& DIM6, Real& J1_w){
    J1_w = -(DIM4*DIM4*DIM4)*(-DIM1+DIM5+DIM6);
}

