void MAST::Solid1DISectionProperty::calcJct(Real& DIM1, Real& DIM2, Real& DIM3, Real& DIM4, Real& DIM5, Real& DIM6, Real& Jct){
    Jct = (DIM6*DIM6*DIM6*DIM6)*(-2.1E+1/1.0E+2)-(1.0/(DIM6*DIM6*DIM6*DIM6*DIM6*DIM6)*pow((DIM4*DIM4)/4.0+DIM6*DIM6,4.0)*((DIM4*DIM4)*7.25E+2+(DIM6*DIM6)*4.2E+2-DIM4*DIM6*2.204E+3))/1.0E+4;
}

void MAST::Solid1DISectionProperty::calcdJct(Real& DIM1, Real& DIM2, Real& DIM3, Real& DIM4, Real& DIM5, Real& DIM6, Real& dDIM1, Real& dDIM2, Real& dDIM3, Real& dDIM4, Real& dDIM5, Real& dDIM6, Real& dJct){
    dJct = (1.0/(DIM6*DIM6*DIM6*DIM6*DIM6*DIM6*DIM6)*dDIM6*(DIM4*(DIM6*DIM6*DIM6*DIM6*DIM6*DIM6*DIM6*DIM6*DIM6)*8.46336E+5-(DIM4*DIM4*DIM4*DIM4*DIM4*DIM4*DIM4*DIM4*DIM4)*DIM6*5.51E+3+pow(DIM4,1.0E+1)*2.175E+3-pow(DIM6,1.0E+1)*1.29024E+6-(DIM4*DIM4)*(DIM6*DIM6*DIM6*DIM6*DIM6*DIM6*DIM6*DIM6)*2.9312E+5+(DIM4*DIM4*DIM4)*(DIM6*DIM6*DIM6*DIM6*DIM6*DIM6*DIM6)*2.82112E+5-(DIM4*DIM4*DIM4*DIM4*DIM4)*(DIM6*DIM6*DIM6*DIM6*DIM6)*1.05792E+5+(DIM4*DIM4*DIM4*DIM4*DIM4*DIM4)*(DIM6*DIM6*DIM6*DIM6)*7.632E+4-(DIM4*DIM4*DIM4*DIM4*DIM4*DIM4*DIM4)*(DIM6*DIM6*DIM6)*5.2896E+4+(DIM4*DIM4*DIM4*DIM4*DIM4*DIM4*DIM4*DIM4)*(DIM6*DIM6)*2.404E+4))/1.28E+6-(1.0/(DIM6*DIM6*DIM6*DIM6*DIM6*DIM6)*dDIM4*pow(DIM4*DIM4+(DIM6*DIM6)*4.0,3.0)*(DIM4*(DIM6*DIM6)*4.58E+3-(DIM4*DIM4)*DIM6*9.918E+3+(DIM4*DIM4*DIM4)*3.625E+3-(DIM6*DIM6*DIM6)*4.408E+3))/1.28E+6;
}

void MAST::Solid1DISectionProperty::calcJcb(Real& DIM1, Real& DIM2, Real& DIM3, Real& DIM4, Real& DIM5, Real& DIM6, Real& Jcb){
    Jcb = (DIM5*DIM5*DIM5*DIM5)*(-2.1E+1/1.0E+2)-(1.0/(DIM5*DIM5)*1.0/(DIM6*DIM6*DIM6*DIM6)*pow((DIM4*DIM4)/4.0+DIM6*DIM6,4.0)*((DIM4*DIM4)*7.25E+2+(DIM5*DIM5)*4.2E+2-DIM4*DIM5*2.204E+3))/1.0E+4;
}

void MAST::Solid1DISectionProperty::calcdJcb(Real& DIM1, Real& DIM2, Real& DIM3, Real& DIM4, Real& DIM5, Real& DIM6, Real& dDIM1, Real& dDIM2, Real& dDIM3, Real& dDIM4, Real& dDIM5, Real& dDIM6, Real& dJcb){
    dJcb = dDIM5*((DIM5*DIM5*DIM5)*(-2.1E+1/2.5E+1)+(1.0/(DIM5*DIM5*DIM5)*1.0/(DIM6*DIM6*DIM6*DIM6)*pow((DIM4*DIM4)/4.0+DIM6*DIM6,4.0)*((DIM4*DIM4)*7.25E+2+(DIM5*DIM5)*4.2E+2-DIM4*DIM5*2.204E+3))/5.0E+3+(1.0/(DIM5*DIM5)*1.0/(DIM6*DIM6*DIM6*DIM6)*pow((DIM4*DIM4)/4.0+DIM6*DIM6,4.0)*(DIM4*2.204E+3-DIM5*8.4E+2))/1.0E+4)-(1.0/(DIM5*DIM5)*1.0/(DIM6*DIM6*DIM6*DIM6)*dDIM4*pow(DIM4*DIM4+(DIM6*DIM6)*4.0,3.0)*(DIM4*(DIM5*DIM5)*1.68E+3-(DIM4*DIM4)*DIM5*9.918E+3+DIM4*(DIM6*DIM6)*2.9E+3-DIM5*(DIM6*DIM6)*4.408E+3+(DIM4*DIM4*DIM4)*3.625E+3))/1.28E+6+(1.0/(DIM5*DIM5)*1.0/(DIM6*DIM6*DIM6*DIM6*DIM6)*dDIM6*(DIM4*DIM4-(DIM6*DIM6)*4.0)*pow(DIM4*DIM4+(DIM6*DIM6)*4.0,3.0)*((DIM4*DIM4)*7.25E+2+(DIM5*DIM5)*4.2E+2-DIM4*DIM5*2.204E+3))/6.4E+5;
}



// TODO: Improve accuracy of calculation of torsion constant and corresponding derivative
void MAST::Solid1DISectionProperty::calcJ(Real& DIM1, Real& DIM2, Real& DIM3, Real& DIM4, Real& DIM5, Real& DIM6, Real& J)
{
    Real t_ft = DIM6;
    Real t_fb = DIM5;
    Real w_ft = DIM3;
    Real w_fb = DIM2;
    Real h_w = DIM1 - DIM5 - DIM6;
    Real t_w = DIM4;
    
    Real k_ft, k_fb, k_w, ct, cb, J_w, J_fb, J_ft;
    Real wf_t = t_w/t_ft;
    Real wf_b = t_w/t_fb;
    
    
    // Sum of rectangles with correction of El Darwish and Johnson
    if ( (wf_t>0.5) and (wf_t<1.0) )
    {
        k_ft = 0.3333333333333333;
        k_w = 0.3333333333333333;
        calcJct(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, ct);
    }
    // Sum of rectangles method, with rectangles corrected for aspect ratios
    else
    {
        if (w_ft>t_ft){
            calck1_ft(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, k_ft);
        }
        else{
            calck2_ft(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, k_ft);
        }
        
        ct = 0.0;
    }
    
    
    // Sum of rectangles with correction of El Darwish and Johnson
    if ( (wf_b>0.5) and (wf_b<1.0) )
    {
        k_fb = 0.3333333333333333;
        k_w = 0.3333333333333333;
        calcJcb(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, cb);
    }
    // Sum of rectangles method, with rectangles corrected for aspect ratios
    else
    {
        if (w_fb>t_fb){
            calck1_fb(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, k_fb);
        }
        else{
            calck2_fb(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, k_fb);
        }
        
        if (h_w>t_w){
            calck1_w(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, k_w);
        }
        else{
            calck2_w(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, k_w);
        }
        cb = 0.0;
    }
    
    
    if (w_ft>t_ft){
        calcJ1_ft(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, J_ft);
    }
    else{
        calcJ2_ft(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, J_ft);
    }
    
    if (w_fb>t_fb){
        calcJ1_fb(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, J_fb);
    }
    else{
        calcJ2_fb(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, J_fb);
    }
    
    if (h_w>t_w){
        calcJ1_w(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, J_w);
    }
    else{
        calcJ2_w(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, J_w);
    }
    
    J = (k_ft*J_ft) + (k_w*J_w) + (k_fb*J_fb) + cb + ct;
}



void MAST::Solid1DISectionProperty::calcdJ(Real& DIM1, Real& DIM2, Real& DIM3, Real& DIM4, Real& DIM5, Real& DIM6, Real& dDIM1, Real& dDIM2, Real& dDIM3, Real& dDIM4, Real& dDIM5, Real& dDIM6, Real& dJ)
{
    Real t_ft = DIM6;
    Real t_fb = DIM5;
    Real w_ft = DIM3;
    Real w_fb = DIM2;
    Real h_w = DIM1 - DIM5 - DIM6;
    Real t_w = DIM4;
    
    Real k_ft, k_fb, k_w, ct, cb, J_w, J_fb, J_ft;
    Real dk_ft, dk_fb, dk_w, dct, dcb, dJ_w, dJ_fb, dJ_ft;
    Real wf_t = t_w/t_ft;
    Real wf_b = t_w/t_fb;
    
    
    // Sum of rectangles with correction of El Darwish and Johnson
    if ( (wf_t>0.5) and (wf_t<1.0) )
    {
        k_ft = 0.3333333333333333;
        k_w = 0.3333333333333333;
        dk_ft = 0.0;
        dk_w = 0.0;
        calcJct(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, ct);
        calcdJct(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6,
                 dDIM1, dDIM2, dDIM3, dDIM4, dDIM5, dDIM6, dct);
    }
    // Sum of rectangles method, with rectangles corrected for aspect ratios
    else
    {
        if (w_ft>t_ft){
            calck1_ft(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, k_ft);
            calcdk1_ft(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, 
                       dDIM1, dDIM2, dDIM3, dDIM4, dDIM5, dDIM6, dk_ft);
            
        }
        else{
            calck2_ft(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, k_ft);
            calcdk2_ft(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, 
                      dDIM1, dDIM2, dDIM3, dDIM4, dDIM5, dDIM6, dk_ft);
        }
        
        ct = 0.0;
        dct = 0.0;
    }
    
    
    // Sum of rectangles with correction of El Darwish and Johnson
    if ( (wf_b>0.5) and (wf_b<1.0) )
    {
        k_fb = 0.3333333333333333;
        k_w = 0.3333333333333333;
        dk_fb = 0.0;
        dk_w = 0.0;
        calcJcb(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, cb);
        calcdJcb(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6,
                 dDIM1, dDIM2, dDIM3, dDIM4, dDIM5, dDIM6, dcb);
    }
    // Sum of rectangles method, with rectangles corrected for aspect ratios
    else
    {
        if (w_fb>t_fb){
            calck1_fb(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, k_fb);
            calcdk1_fb(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6,
                       dDIM1, dDIM2, dDIM3, dDIM4, dDIM5, dDIM6, dk_fb);
        }
        else{
            calck2_fb(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, k_fb);
            calcdk2_fb(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6,
                      dDIM1, dDIM2, dDIM3, dDIM4, dDIM5, dDIM6, dk_fb);
        }
        
        if (h_w>t_w){
            calck1_w(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, k_w);
            calcdk1_w(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6,
                     dDIM1, dDIM2, dDIM3, dDIM4, dDIM5, dDIM6, dk_w);
        }
        else{
            calck2_w(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, k_w);
            calcdk2_w(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6,
                     dDIM1, dDIM2, dDIM3, dDIM4, dDIM5, dDIM6, dk_w);
        }
        cb = 0.0;
        dcb = 0.0;
    }
    
    
    if (w_ft>t_ft){
        calcJ1_ft(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, J_ft);
        calcdJ1_ft(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, 
                   dDIM1, dDIM2, dDIM3, dDIM4, dDIM5, dDIM6, dJ_ft);
    }
    else{
        calcJ2_ft(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, J_ft);
        calcdJ2_ft(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, 
                   dDIM1, dDIM2, dDIM3, dDIM4, dDIM5, dDIM6, dJ_ft);
    }
    
    if (w_fb>t_fb){
        calcJ1_fb(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, J_fb);
        calcdJ1_fb(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6,
                   dDIM1, dDIM2, dDIM3, dDIM4, dDIM5, dDIM6, dJ_fb);
    }
    else{
        calcJ2_fb(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, J_fb);
        calcdJ2_fb(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6,
                   dDIM1, dDIM2, dDIM3, dDIM4, dDIM5, dDIM6, dJ_fb);
    }
    
    if (h_w>t_w){
        calcJ1_w(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, J_w);
        calcdJ1_w(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6,
                  dDIM1, dDIM2, dDIM3, dDIM4, dDIM5, dDIM6, dJ_w);
    }
    else{
        calcJ2_w(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, J_w);
        calcdJ2_w(DIM1, DIM2, DIM3, DIM4, DIM5, DIM6, 
                  dDIM1, dDIM2, dDIM3, dDIM4, dDIM5, dDIM6, dJ_w);
    }
    
    //J = (k_ft*J_ft) + (k_w*J_w) + (k_fb*J_fb) + cb + ct;
    dJ = (dk_ft*J_ft + k_ft*dJ_ft) + (dk_w*J_w + k_w*dJ_w) + (dk_fb*J_fb + k_fb*dJ_fb) + dcb + dct;
}





void MAST::Solid1DISectionElementPropertyCard::init() {
    
    libmesh_assert(!_initialized);
    
    MAST::FieldFunction<Real>
    &DIM1     =  this->get<MAST::FieldFunction<Real> >("DIM1"),
    &DIM2     =  this->get<MAST::FieldFunction<Real> >("DIM2"),
    &DIM3     =  this->get<MAST::FieldFunction<Real> >("DIM3"),
    &DIM4     =  this->get<MAST::FieldFunction<Real> >("DIM4"),
    &DIM5     =  this->get<MAST::FieldFunction<Real> >("DIM5"),
    &DIM6     =  this->get<MAST::FieldFunction<Real> >("DIM6"),
    &hy_off =  this->get<MAST::FieldFunction<Real> >("hy_off"),
    &hz_off =  this->get<MAST::FieldFunction<Real> >("hz_off");
    
    // Check that dimensions are physically correct
    Real DIM1v, DIM2v, DIM3v, DIM4v, DIM5v, DIM6v;
    DIM1(DIM1v); DIM2(DIM2v); DIM3(DIM3v); DIM4(DIM4v); DIM5(DIM5v); DIM6(DIM6v);
    if (DIM1v<=0){
        libmesh_error_msg("DIM1<=0");
    }
    else if (DIM2v<=0){
        libmesh_error_msg("DIM2<=0");
    }
    else if (DIM3v<=0){
        libmesh_error_msg("DIM3<=0");
    }
    else if (DIM4v<=0){
        libmesh_error_msg("DIM4<=0");
    }
    else if (DIM5v<=0){
        libmesh_error_msg("DIM5<=0");
    }
    else if (DIM6v<=0){
        libmesh_error_msg("DIM6<=0");
    }
    else if ((DIM5v+DIM6v)>=DIM1v){
        libmesh_error_msg("(DIM5+DIM6)>=DIM1");
    }
    else if (DIM4v>=std::min(DIM2v, DIM3v)){
        libmesh_error_msg("DIM4>=min(DIM2, DIM3)");
    }
    
    
    _A.reset(new MAST::Solid1D6ParameterSectionProperty::Area(MAST::Solid1DISectionProperty::calcA,
                                                              MAST::Solid1DISectionProperty::calcdA,
                                                              DIM1, DIM2, DIM3, 
                                                              DIM4, DIM5, DIM6));
    
    _Ay.reset(new MAST::Solid1D6ParameterSectionProperty::AreaYMoment(
                                                                MAST::Solid1DISectionProperty::calcA,
                                                                MAST::Solid1DISectionProperty::calcdA,
                                                                DIM1, DIM2, 
                                                                DIM3, DIM4, 
                                                                DIM5, DIM6,
                                                                hz_off));
    
    _Az.reset(new MAST::Solid1D6ParameterSectionProperty::AreaZMoment(
                                                                MAST::Solid1DISectionProperty::calcA,
                                                                MAST::Solid1DISectionProperty::calcdA,
                                                                DIM1, DIM2, 
                                                                DIM3, DIM4,
                                                                DIM5, DIM6,
                                                                hy_off));
    
    _J.reset(new MAST::Solid1D6ParameterSectionProperty::TorsionalConstant(
                                                                MAST::Solid1DISectionProperty::calcJ,
                                                                MAST::Solid1DISectionProperty::calcdJ,
                                                                DIM1, DIM2,
                                                                DIM3, DIM4,
                                                                DIM5, DIM6));
    
    _Ip.reset(new MAST::Solid1D6ParameterSectionProperty::PolarInertia(
                                                                MAST::Solid1DISectionProperty::calcIp,
                                                                MAST::Solid1DISectionProperty::calcdIp,
                                                                MAST::Solid1DISectionProperty::calcA,
                                                                MAST::Solid1DISectionProperty::calcdA,
                                                                DIM1, DIM2,
                                                                DIM3, DIM4,
                                                                DIM5, DIM6,
                                                                hy_off,
                                                                hz_off));
    
    _AI.reset(new MAST::Solid1D6ParameterSectionProperty::AreaInertiaMatrix(
                                                                MAST::Solid1DISectionProperty::calcIz,
                                                                MAST::Solid1DISectionProperty::calcdIz,
                                                                MAST::Solid1DISectionProperty::calcIy,
                                                                MAST::Solid1DISectionProperty::calcdIy,
                                                                MAST::Solid1DISectionProperty::calcA,
                                                                MAST::Solid1DISectionProperty::calcdA,
                                                                DIM1, DIM2,
                                                                DIM3, DIM4,
                                                                DIM5, DIM6,
                                                                hy_off,
                                                                hz_off));
    
    _initialized = true;
}

